"use strict";
class Vehicle04 {
    constructor(id, name, year, company) {
        this.id = id;
        this.name = name;
        this.year = year;
        this.company = company;
    }
}
const vehicle104 = new Vehicle04(1, "oto", 2000, "Toyota");
const vehicle204 = new Vehicle04(2, "xemay", 2000, "Yamaha");
console.log(vehicle104);
console.log(vehicle204);
